import React from 'react'

const Content = ([...parts],[...exercises]) => {
    return(
        <>
            <p>
                {parts[0]} {exercises[0]}
            </p>
            <p>
                {parts[1]} {exercises[1]}
            </p>
            <p>
                {parts[2]} {exercises[2]}
            </p>
        </>
    )
};

export default Content;
